import Link from 'next/link';

const Nav = () => (
  <nav>
    <Link href="/">
      <a>Home</a>
    </Link>
    <Link href="/about">
      <a>About</a>
    </Link>

    <style jsx>{`
      :global(body) {
        font-family: sans-serif;
      }
      nav {
        text-align: center;
        background-color: blue;
        height: 50px;
        margin-top: 50px;
      }
      nav a {
        color: #f5f5f5;
        text-decoration: none;
        font-size: 14px;
        padding: 20px;
        text-transform: uppercase;
      }
      nav a:hover {
        color: #ffffff;
        font-weight: bold;
      }
      `}
    </style>
  </nav>
);

export default Nav;
